import React, { useState } from 'react';

const SimpleDataPanel = ({ onClose, onSave, currentData }) => {
  const [rawText, setRawText] = useState('');
  const [error, setError] = useState('');

  const handleSave = () => {
    if (!rawText.trim()) {
      setError('Please paste some data first');
      return;
    }

    try {
      // Simple parsing - no complex regex, just basic text processing
      const lines = rawText.split('\n').map(l => l.trim()).filter(Boolean);

      const menu = {
        breakfast: extractMealData(lines, 'breakfast'),
        lunch: extractMealData(lines, 'lunch'), 
        snacks: extractMealData(lines, 'snacks'),
        dinner: extractMealData(lines, 'dinner')
      };

      const buses = extractBusData(lines);

      const newData = {
        menu: { ...currentData.menu, ...menu },
        buses: buses.routes.length > 0 ? buses : currentData.buses
      };

      onSave(newData);
    } catch (err) {
      setError('Could not parse the data. Please check the format.');
    }
  };

  const extractMealData = (lines, mealType) => {
    const line = lines.find(l => 
      l.toLowerCase().startsWith(mealType.toLowerCase() + ':')
    );
    return line ? line.split(':').slice(1).join(':').trim() : '';
  };

  const extractBusData = (lines) => {
    const routes = [];
    const busLines = lines.filter(line => line.includes('→') || line.includes('->'));

    busLines.forEach(line => {
      const parts = line.split(':');
      if (parts.length >= 2) {
        const route = parts[0].trim().replace('->', '→');
        const timesStr = parts.slice(1).join(':');
        const times = timesStr.split(',').map(t => t.trim()).filter(Boolean);
        if (times.length > 0) {
          routes.push({ route, times });
        }
      }
    });

    return { routes };
  };

  return (
    <div className="modal-backdrop" role="dialog" aria-modal="true">
      <div className="modal">
        <div className="modal-header">
          <h3>Update Menu & Bus Schedule</h3>
          <button className="icon-btn" onClick={onClose} aria-label="Close">✕</button>
        </div>

        <div className="help-text">
          <p><strong>Simple Instructions:</strong></p>
          <p>1. Get the menu/bus email from your admin</p>
          <p>2. Copy the text content and paste it below</p>
          <p>3. Click Save - that's it!</p>

          <div className="format-example">
            <strong>Expected format:</strong><br/>
            Breakfast: Idly, Vada, Sambar<br/>
            Lunch: Rice, Dal, Curry<br/>
            Snacks: Tea, Biscuits<br/>
            Dinner: Chapati, Paneer<br/>
            <br/>
            Nila → Sahyadri: 9:00 PM, 10:00 PM<br/>
            Sahyadri → Nila: 9:15 PM, 10:15 PM
          </div>
        </div>

        <label className="field-label">Paste the menu and bus schedule text:</label>
        <textarea
          className="text-input"
          rows={10}
          placeholder="Paste your menu and bus schedule here..."
          value={rawText}
          onChange={(e) => setRawText(e.target.value)}
        />

        {error && <div className="error-text">{error}</div>}

        <div className="quick-demo">
          <button 
            className="demo-btn" 
            onClick={() => setRawText(`Breakfast: Poha, Tea, Banana
Lunch: Rice, Dal, Sabzi, Roti
Snacks: Samosa, Chai
Dinner: Biryani, Raita, Papad

Nila → Sahyadri: 8:00 PM, 9:00 PM, 10:00 PM
Sahyadri → Nila: 8:15 PM, 9:15 PM, 10:15 PM`)}
          >
            Try Demo Data
          </button>
        </div>

        <div className="modal-footer">
          <button className="secondary-btn" onClick={onClose}>Cancel</button>
          <button className="primary-btn" onClick={handleSave}>Save Data</button>
        </div>
      </div>
    </div>
  );
};

export default SimpleDataPanel;
